script: |
  super -f text -I q1950.spq | sort > q1950.out

inputs:
  - name: q1950.spq
    data: |
      SELECT ALL + col0 * + col0 + - col2 / 34 + + col0 + - ( col1 ) + + 6 FROM tab1 (FORMAT parquet) AS cor0 WHERE + 97 NOT IN ( + col0 );
  - name: tab1

outputs:
  - name: q1950.out
    data: |
      2642
      7310
      8329
